  Andrew b. at Christchurch.
  08> 'WILLIAMS, George Coldham m on 26.06.1889 to (1) BRAITHWAITE, Ethel Norma
  b 26.04.1858 d 08.05.1944
  b 07.06.1864 d 22.05.1912
  George b. at Waimate and d. at Wellington. Ethel was from Taranaki.
  George farmed on "Rangitapu" at Omakere in Hawkes Bay. He was active in church affairs
  and was a lay reader.
  01> WILLIAMS, Enid Constance m on 19.11.1912 to MURPHY, Robert Keith
  b 05.06.1890 d 30.03.1964
  b 14.12.1882 d 15.10.1954
  Enid b. at Napier and d. at Gisborne. Robert, s/o Edward Murphy and Ethel Read Moore, d, at Gisborne.
  Rob farmed on "Waiau" station then purchased "Maraetaha".
  01> MURPHY, Ethel Mary m on ** **, 1939 to FAULKNER, Frederick Edward
  b 11.01.1914 d 04.05.1990
  b 23.04.1911 d 20.07.1980
  Ethel b. at Gisborne. Frederick, slo Albert Joseph Faulkner and Muriel Buchanan Williams. Their
  biography and descendants are listed under Frederick's entry in this Family Tree.
  02> MURPHY, Monica Constance m on 05.02.1947 to NEWTON, Edward Thomas Charles
  b 16.09.1915 d 28.02.1971
  b 24.01.1909 d 29.03.1971
  Monica b. at Gisborne, m. at Toku Toru Tapu Church, Manutuke and d. at Christchurch. Thomas, s/o Ben
  Newton and Annie Bullock, b. and d. at Ashburton.
  Monica grew up at "Maretaha" station in Muriwai and was educated at Woodford House. During WW2 she
  worked as a land girl at "Maretaha", and as a psychiatric nurse in Avondale, Auckland. In 1947, after
  her marriage to Tom, she moved to Ashburton, where during the years she was raising her children, she
  was actively involved in the local Pony Club. Monica died of cancer in the Christchurch Public
  Hospital.
  Tom was the second of six children and was educated at Waihi, Christ's College and Oxford University.
  He was in the Army during ww2 and served in North Africa, Greece, Crete and Italy. After the war he
  bought "The Willows", a small property near Ashburton, which had once belonged to his grandfather. He
  also took over the management of his grandfather's real estate business, Bullock and Co, which he ran
  until his illness in 1970.
  01> NEWTON, Elizabeth Enid m on 16.09.1977 to MITCHELL, Pierre Claude
  b 26.02.1949
  b 06.04.1948
  Elizabeth b. at Ashburton and m, at Christchurch. Pierre, s/o Jacques Mitchell and Gaby Rousseau,
  b. at Montreal, Canada. Address: 15 Wolfe Street, Nelson.
  After attending Craighead School in Timaru, Libby trained as a radiographer at the Christchurch
  Hospital. From 1972 to 1976 she travelled extensively, working in the United States and as a
  radiographer in London. She met Pierre while travelling in Afghanistan in 1975. They moved to
  Nelson in 1979. From 1994 to 1997 Libby and her family lived in Montreal, Canada, during which
  time she trained as a Polarity Practitioner in the United States. They now live in Nelson.
